import React from 'react'
import './App.css'

class App extends React.Component {
  constructor (props) {
    super(props)
    this.state = { value: 'How are you?' }
    this.URI = 'https://data.corona.go.jp/converted-json/covid19japan-all.json'
  }

  componentDidMount () {
    window
      .fetch(this.URI)
      .then(res => res.json())
      .then(json => json[0].area[46])
      .then(console.log)
  }

  render () {
    return <></>
  }
}

export default App
